$(function(){QUnit.module("scrollspy plugin");QUnit.test("should be defined on jquery object",function(a){a.expect(1);a.ok($(document.body).scrollspy,"scrollspy method is defined")});QUnit.module("scrollspy",{beforeEach:function(){$.fn.bootstrapScrollspy=$.fn.scrollspy.noConflict()},afterEach:function(){$.fn.scrollspy=$.fn.bootstrapScrollspy;delete $.fn.bootstrapScrollspy}});QUnit.test("should provide no conflict",function(a){a.expect(1);a.strictEqual($.fn.scrollspy,undefined,"scrollspy was set back to undefined (org value)")});QUnit.test("should return jquery collection containing the element",function(a){a.expect(2);var c=$("<div/>");var b=c.bootstrapScrollspy();a.ok(b instanceof $,"returns jquery collection");a.strictEqual(b[0],c[0],"collection contains element")});QUnit.test('should only switch "active" class on current target',function(c){c.expect(1);var b=c.async();var a='<div id="root" class="active"><div class="topbar"><div class="topbar-inner"><div class="container" id="ss-target"><ul class="nav"><li><a href="#masthead">Overview</a></li><li><a href="#detail">Detail</a></li></ul></div></div></div><div id="scrollspy-example" style="height: 100px; overflow: auto;"><div style="height: 200px;"><h4 id="masthead">Overview</h4><p style="height: 200px">Ad leggings keytar, brunch id art party dolor labore.</p></div><div style="height: 200px;"><h4 id="detail">Detail</h4><p style="height: 200px">Veniam marfa mustache skateboard, adipisicing fugiat velit pitchfork beard.</p></div></div></div>';var e=$(a).appendTo("#qunit-fixture");var d=e.show().find("#scrollspy-example").bootstrapScrollspy({target:"#ss-target"});d.on("scroll.bs.scrollspy",function(){c.ok(e.hasClass("active"),'"active" class still on root node');b()});d.scrollTop(350)});QUnit.test("should correctly select middle navigation option when large offset is used",function(c){c.expect(3);var b=c.async();var a='<div id="header" style="height: 500px;"></div><nav id="navigation" class="navbar"><ul class="nav navbar-nav"><li class="active"><a id="one-link" href="#one">One</a></li><li><a id="two-link" href="#two">Two</a></li><li><a id="three-link" href="#three">Three</a></li></ul></nav><div id="content" style="height: 200px; overflow-y: auto;"><div id="one" style="height: 500px;"></div><div id="two" style="height: 300px;"></div><div id="three" style="height: 10px;"></div></div>';var e=$(a).appendTo("#qunit-fixture");var d=e.show().filter("#content");d.bootstrapScrollspy({target:"#navigation",offset:d.position().top});d.on("scroll.bs.scrollspy",function(){c.ok(!e.find("#one-link").parent().hasClass("active"),'"active" class removed from first section');c.ok(e.find("#two-link").parent().hasClass("active"),'"active" class on middle section');c.ok(!e.find("#three-link").parent().hasClass("active"),'"active" class not on last section');b()});d.scrollTop(550)});QUnit.test("should add the active class to the correct element",function(b){b.expect(2);var f='<nav class="navbar"><ul class="nav"><li id="li-1"><a href="#div-1">div 1</a></li><li id="li-2"><a href="#div-2">div 2</a></li></ul></nav>';var e='<div class="content" style="overflow: auto; height: 50px"><div id="div-1" style="height: 100px; padding: 0; margin: 0">div 1</div><div id="div-2" style="height: 200px; padding: 0; margin: 0">div 2</div></div>';$(f).appendTo("#qunit-fixture");var c=$(e).appendTo("#qunit-fixture").bootstrapScrollspy({offset:0,target:".navbar"});var a=b.async();var d=function(h,j){var g=$.Deferred();var i=Math.ceil(c.scrollTop()+$(j).position().top);c.one("scroll",function(){b.ok($(h).hasClass("active"),"target:"+j+", element"+h);g.resolve()});c.scrollTop(i);return g.promise()};$.when(d("#li-1","#div-1")).then(function(){return d("#li-2","#div-2")}).then(function(){a()})});QUnit.test("should add the active class correctly when there are nested elements at 0 scroll offset",function(b){b.expect(6);var g=0;var a=b.async();var f='<nav id="navigation" class="navbar"><ul class="nav"><li id="li-1"><a href="#div-1">div 1</a><ul><li id="li-2"><a href="#div-2">div 2</a></li></ul></li></ul></nav>';var e='<div class="content" style="position: absolute; top: 0px; overflow: auto; height: 50px"><div id="div-1" style="padding: 0; margin: 0"><div id="div-2" style="height: 200px; padding: 0; margin: 0">div 2</div></div></div>';$(f).appendTo("#qunit-fixture");var d=$(e).appendTo("#qunit-fixture").bootstrapScrollspy({offset:0,target:"#navigation"});!function c(){if(++g>3){return a()}d.one("scroll",function(){b.ok($("#li-1").hasClass("active"),'nav item for outer element has "active" class');b.ok($("#li-2").hasClass("active"),'nav item for inner element has "active" class');c()});d.scrollTop(d.scrollTop()+10)}()});QUnit.test("should clear selection if above the first section",function(d){d.expect(3);var c=d.async();var b='<div id="header" style="height: 500px;"></div><nav id="navigation" class="navbar"><ul class="nav navbar-nav"><li class="active"><a id="one-link" href="#one">One</a></li><li><a id="two-link" href="#two">Two</a></li><li><a id="three-link" href="#three">Three</a></li></ul></nav>';$(b).appendTo("#qunit-fixture");var a='<div id="content" style="height: 200px; overflow-y: auto;"><div id="spacer" style="height: 100px;"/><div id="one" style="height: 100px;"/><div id="two" style="height: 100px;"/><div id="three" style="height: 100px;"/><div id="spacer" style="height: 100px;"/></div>';var e=$(a).appendTo("#qunit-fixture");e.bootstrapScrollspy({target:"#navigation",offset:e.position().top}).one("scroll.bs.scrollspy",function(){d.strictEqual($(".active").length,1,'"active" class on only one element present');d.strictEqual($(".active").has("#two-link").length,1,'"active" class on second section');e.one("scroll.bs.scrollspy",function(){d.strictEqual($(".active").length,0,"selection cleared");c()}).scrollTop(0)}).scrollTop(201)});QUnit.test("should correctly select navigation element on backward scrolling when each target section height is 100%",function(b){b.expect(5);var f='<nav class="navbar"><ul class="nav"><li id="li-100-1"><a href="#div-100-1">div 1</a></li><li id="li-100-2"><a href="#div-100-2">div 2</a></li><li id="li-100-3"><a href="#div-100-3">div 3</a></li><li id="li-100-4"><a href="#div-100-4">div 4</a></li><li id="li-100-5"><a href="#div-100-5">div 5</a></li></ul></nav>';var e='<div class="content" style="position: relative; overflow: auto; height: 100px"><div id="div-100-1" style="position: relative; height: 100%; padding: 0; margin: 0">div 1</div><div id="div-100-2" style="position: relative; height: 100%; padding: 0; margin: 0">div 2</div><div id="div-100-3" style="position: relative; height: 100%; padding: 0; margin: 0">div 3</div><div id="div-100-4" style="position: relative; height: 100%; padding: 0; margin: 0">div 4</div><div id="div-100-5" style="position: relative; height: 100%; padding: 0; margin: 0">div 5</div></div>';$(f).appendTo("#qunit-fixture");var c=$(e).appendTo("#qunit-fixture").bootstrapScrollspy({offset:0,target:".navbar"});var d=function(h,j){var g=$.Deferred();var i=Math.ceil(c.scrollTop()+$(j).position().top);c.one("scroll",function(){b.ok($(h).hasClass("active"),"target:"+j+", element: "+h);g.resolve()});c.scrollTop(i);return g.promise()};var a=b.async();$.when(d("#li-100-5","#div-100-5")).then(function(){return d("#li-100-4","#div-100-4")}).then(function(){return d("#li-100-3","#div-100-3")}).then(function(){return d("#li-100-2","#div-100-2")}).then(function(){return d("#li-100-1","#div-100-1")}).then(function(){a()})})});